import React, { useState, useCallback } from "react";
import { useDropzone } from "react-dropzone";
import axios from "axios";
import { Line } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";
import "./App.css";

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

const API_PREDICT = "http://192.168.1.205:5000/predict";

function App() {
  const [predictions, setPredictions] = useState([]);
  const [loading, setLoading] = useState(false);
  const [fileName, setFileName] = useState("");
  const [chartData, setChartData] = useState(null);

  const onDrop = useCallback(async (acceptedFiles) => {
    const file = acceptedFiles[0];
    setFileName(file.name);
    await handleFileUpload(file);
  }, []);

  const { getRootProps, getInputProps, isDragActive } = useDropzone({ onDrop });

  const handleFileUpload = async (file) => {
    setLoading(true);
    const formData = new FormData();
    formData.append("file", file);

    try {
      const response = await axios.post(API_PREDICT, formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });

      if (response.data.status === "success") {
        const result = response.data.predictions;
        setPredictions(result);

        // Create a basic trend chart
        const normalCount = result.filter((r) => r.prediction === 0).length;
        const attackCount = result.filter((r) => r.prediction === 1).length;

        setChartData({
          labels: ["Normal", "Attack"],
          datasets: [
            {
              label: "Traffic Type Distribution",
              data: [normalCount, attackCount],
              borderColor: "rgba(75,192,192,1)",
              backgroundColor: "rgba(75,192,192,0.2)",
            },
          ],
        });

        alert("‚úÖ Prediction completed successfully!");
      } else {
        alert("‚ö†Ô∏è Error: " + response.data.message);
      }
    } catch (error) {
      alert("‚ùå Upload failed: " + error.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gray-900 text-white flex flex-col items-center justify-center p-6">
      <h1 className="text-3xl font-bold mb-6 text-cyan-400">üß† NIDS Dashboard</h1>

      {/* Dropzone */}
      <div
        {...getRootProps()}
        className={`border-2 border-dashed p-10 rounded-2xl w-full max-w-xl text-center cursor-pointer transition ${
          isDragActive ? "border-cyan-400 bg-gray-800" : "border-gray-600 bg-gray-800"
        }`}
      >
        <input {...getInputProps()} />
        {isDragActive ? (
          <p>üìÇ Drop your dataset file here...</p>
        ) : (
          <p>Drag & drop a CSV file here, or click to select one</p>
        )}
        {fileName && <p className="mt-2 text-sm text-gray-400">Uploaded: {fileName}</p>}
      </div>

      {/* Loading Spinner */}
      {loading && (
        <div className="mt-6 animate-pulse text-cyan-300">
          ‚è≥ Processing file and predicting...
        </div>
      )}

      {/* Chart */}
      {chartData && (
        <div className="w-full max-w-md mt-8 bg-gray-800 p-4 rounded-xl shadow-lg">
          <Line data={chartData} />
        </div>
      )}

      {/* Predictions Table */}
      {predictions.length > 0 && (
        <div className="w-full max-w-4xl mt-10 overflow-auto bg-gray-800 rounded-xl p-4 shadow-lg">
          <h2 className="text-xl font-semibold mb-4 text-cyan-300">Prediction Results</h2>
          <table className="w-full border-collapse border border-gray-700 text-sm">
            <thead>
              <tr className="bg-gray-700 text-cyan-300">
                {Object.keys(predictions[0]).map((key) => (
                  <th key={key} className="border border-gray-600 px-3 py-2">
                    {key}
                  </th>
                ))}
              </tr>
            </thead>
            <tbody>
              {predictions.slice(0, 10).map((row, i) => (
                <tr
                  key={i}
                  className={`${
                    row.prediction === 1
                      ? "bg-red-900/50 hover:bg-red-800/70"
                      : "bg-green-900/40 hover:bg-green-800/70"
                  }`}
                >
                  {Object.values(row).map((value, j) => (
                    <td key={j} className="border border-gray-600 px-3 py-1 text-center">
                      {String(value)}
                    </td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
          <p className="text-xs text-gray-400 mt-3">Showing first 10 rows...</p>
        </div>
      )}
    </div>
  );
}

export default App;
